import React, { useState } from 'react';
import FindPdfs from './components/FindPdfs';
import MergePdfs from './components/MergePdfs';
import './App.css';

const App = () => {
    const [pdfList, setPdfList] = useState([]);

    return (
        <div className="App">
            <header className="App-header">
                <h1>PDF Merger</h1>
            </header>
            <main>
                <FindPdfs setPdfList={setPdfList} />
                {pdfList.length > 0 && <MergePdfs pdfList={pdfList} />}
            </main>
        </div>
    );
};

export default App;
